DESCRIPTION:
Namo, esančio Jaunystės g. 1, Visagino m., 2-os laiptinės gyventojai primygtinai prašo nupjauti prie pat namo augančius medžius ir išrauti jų šaknis:
1) šermukšnį, augantį prie įėjimo į namo 2-ą laiptinę. Šis medis yra seniai sergantis, beveik be lapų, visas jo stiebas apaugęs samanomis bei kerpėmis. Stiprus vėjas nuolat laužo jo šakas ir numeta jas į langus ir balkonus, kartu numetami ir sergantys lapai. Yra pavojus, kad šis šermukšnis nuo vėjo gali nukristi į gyventojų langus. Be to, šis medis auga arčiau nei 3 m. nuo namo sienos;
2) liepą (auga prie įėjimo į namo 2-ą laiptinę), nes ji taip pat yra arčiau nei 3 m. nuo namo sienos. Prieš maždaug 4-5 metus ten pat buvo nupjautas medis, tačiau šaknys liko žemėje;
3) taip pat prašome iš išorinės 2-os laiptinės pusės išrauti klevo, liepos, lazdyno ūglius, o taip pat praretinti ievos krūmus. 

