ANSWER:
 Gerbiamas pranešėjau,
Savivaldybės administracija gavo Jūsų 2023 m. liepos 7 d. prašymą suteikti administracinę paslaugą „Tvarkau miestą pranešimas (Pastatų administravimas)“ (Savivaldybėje registruota 2023 m. liepos 7 d., reg. Nr. E938-12859/23(3.2.55E-AD24) dėl galbūt nesilaikomų Lietuvos Respublikos valstybės vėliavos ir kitų vėliavų įstatymo (toliau – Įstatymas) reikalavimų, pakabinant Ukrainos vėliavą ant Karoliniškių poliklinikos pastato L. Asanavičiūtės g. 27A, Vilniuje.
Įstatymo 5 straipsnyje nurodyta, kad Lietuvos valstybės vėliava nuolat iškeliama prie, virš ar ant šių pastatų:
1) Lietuvos Respublikos Seimo;
2) Respublikos Prezidento rezidencijos;
3) Lietuvos Respublikos Vyriausybės ir ministerijų;
4) Lietuvos Respublikos Konstitucinio Teismo;
5) Lietuvos Respublikos teismų;
6) Lietuvos Respublikos generalinės prokuratūros ir teritorinių prokuratūrų;
7) Lietuvos banko;
8) Lietuvos Respublikos vyriausiosios rinkimų komisijos;
9) Gedimino pilies bokšte Vilniuje;
10) Signatarų namų Vilniuje;
11) kuriuose posėdžiauja savivaldybės taryba.
12) pasienio kontrolės punktuose – tarptautiniuose oro uostuose, atviruose tarptautinei laivybai jūrų ir upių (vidaus vandenų) uostuose, geležinkelio stotyse ar prie automobilių kelių Lietuvos Respublikos Vyriausybės nutarimu įsteigtose vietose, kuriose patikrinimą atlieka Valstybės sienos apsaugos tarnyba prie Lietuvos Respublikos vidaus reikalų ministerijos, muitinė ir kitos įgaliotos valstybės institucijos.
Karoliniškių poliklinikos pastatas į šį sąrašą nepatenka. Įstatymas nedraudžia juridiniam asmeniui iškelti užsienio valstybės vėliavą. Įstatymas taip pat neįpareigoja juridinio asmens kada iškabinti ar nukabinti užsienio valstybės vėliavą. Atsižvelgiant į tai, nėra teisinio pagrindo konstatuoti, kad yra pažeisti Įstatymo reikalavimai.
Įstatymo 12 straipsnio 6 dalyje nurodyta, kad fiziniai ir juridiniai asmenys gali savo nuožiūra naudoti (kelti, pastatyti) užsienio valstybių tautines (nacionalines), Europos Sąjungos ar tarptautinių viešųjų organizacijų vėliavas ir (arba) vėliavėles laikydamiesi vėliavų naudojimo principų ir tik tokiu būdu, kad nebūtų parodyta nepagarba šioms vėliavoms.
Šiuo neramiu laikotarpiu mūsų valstybėje atsiranda susipriešinimas tarp atskirų pažiūrų asmenų ir bendruomenių. Nenuostabu, kad susiklosčiusi politinė situacija daugybę žmonių paveikė psichologiškai ir emociškai. Ukrainos žmonės priešinasi, kovoja už laisvę, o mes privalome juos palaikyti bei jiems padėti. Lietuvos žmonių palaikymas ir aukos yra didžiausia padėka. Nepaisant visko, Ukraina parodė savo galią. Jos stipriausias ginklas – žmonių vienybė ir palaikymas iš viso pasaulio. Žmonės iš viso pasaulio jungėsi (ir tebesijungia) į akcijas, išreikšdami palaikymą Ukrainai.
Akivaizdu, kad tokio karo akivaizdoje, siekiama paremti tautą, kovojančią kare, todėl asmenys iškelia Ukrainos vėliavas. Turime bendradarbiauti, palaikyti ir rasti abipusį supratimą. Ne kas kitas, o mes turime bent morališkai palaikyti ir laikytis išvien, norint įveikti agresorių.
Siekiame, kad Vilniuje gyvenantys asmenys miestą traktuotų kaip žmogaus tobulėjimo erdvę, kurioje jie turi būti saugūs ir laimingi. Kasdien susidurdami su visuomenėje egzistuojančiomis problemomis, dedame visas pastangas ne tik kurdami gyventojų gerovę, bet ir siekiame formuoti atsakingą gyventojų požiūrį į juos supančią aplinką.
Jei ateityje pastebėsite, kad asmenys galbūt daro pažeidimus, apie tai praneškite policijai skambindami telefonu 112 ar naudodamiesi mobiliąja programėle ePolicija, ar parašydami anonimiškai <a href="https://www.epolicija.lt/web/guest/report-anonymous," target="_blank">https://www.epolicija.lt/web/guest/report-anonymous,</a> ar prisijungę per elektroninius valdžios vartus ir naudodamiesi elektronine paslauga <a href="https://www.epolicija.lt/web/guest/choose-reporting-service-guest" target="_blank">https://www.epolicija.lt/web/guest/choose-reporting-service-guest</a>. Viešosios tvarkos ir visuomenės saugumo užtikrinimas yra pagrindiniai policijos uždaviniai, todėl nenutrūkstamas policijos darbas organizuojamas visą parą.
Savivaldybės administracijos Viešosios tvarkos skyriui galite pranešti telefonu (8 5) 219 7948 ar elektroniniu paštu <a href="mailto:viesoji.tvarka@vilnius.lt.">viesoji.tvarka@vilnius.lt.</a> Skundą galima pateikti prisijungus per elektroninius valdžios vartus ir naudojantis elektronine paslauga <a href="https://paslaugos.vilnius.lt/service/Fiziniu-ir-juridiniu-asmenu-skundu-(" target="_blank">https://paslaugos.vilnius.lt/service/Fiziniu-ir-juridiniu-asmenu-skundu-(</a>pranesimu)-adresuotu-Savivaldybei-priemimas. Viešosios tvarkos skyrius kontroliuoja, kaip asmenys laikosi įvairių teisės aktų reikalavimų, todėl apgailestaujame, kad nėra galimybės skirti ypatingą dėmesį vienai konkrečiai problemai ir ne visada pavyksta į pranešimus reaguoti nedelsiant. Visa asmenų pateikiama informacija mums yra svarbi. Atsižvelgdami į prioritetus, pareigūnai kiekvieną pranešimą vertina individualiai ir pirmiausia imasi efektyvių priemonių, kad išsiaiškintų pažeidimų priežastis bei jas pašalintų. Savivaldybės administracijos padaliniai tik dalyvauja, bendradarbiauja užtikrindami viešąją tvarką, todėl neturi galimybės nuolat ir nedelsdami reaguoti į asmenų pranešimus apie galbūt padarytus pažeidimus. Viešosios tvarkos skyriaus pareigūnai dirba pirmadieniais–ketvirtadieniais nuo 6 iki 23 val., penktadieniais nuo 6 iki 24 val., šeštadieniais nuo 0 iki 2 val. ir nuo 8 iki 24 val., sekmadieniais nuo 0 iki 2 val. ir nuo 8 iki 22 val.

 Laba diena,

Dėkojame už pranešimą.

